import "../index.css";
import { Link, useNavigate } from "react-router-dom";
import IconButton from './icon_button'

function NavigationMenu ({loggedIn, isAdmin}) {
	const navigate = useNavigate();
	return (
		<div className="navigation-menu">
			{loggedIn.length === 0 &&
				<IconButton icon="bx:user-circle" hoverClass='color-hover' callback={() => navigate("/login")} className="nav-button"/>
			}
			{loggedIn.length !== 0 && !isAdmin &&
				<IconButton icon="bx:user-circle" hoverClass='color-hover' callback={() => navigate("/update_info")} className="nav-button"/>
			}
			{loggedIn.length !== 0 && isAdmin &&
				<IconButton icon="bx:user-circle" hoverClass='color-hover' callback={() => navigate("/admin_page")} className="nav-button"/>
			}
			<IconButton icon="bx:cart" hoverClass='color-hover' callback={() => navigate("/cart")}/>
		</div>
	)
}

function Header({loggedIn, isAdmin}) {
	const navigate = useNavigate();
	return (
		<header className="header">
			<div className="logo" onClick={() => navigate("/")}>
				<h1>GoodGlassesGG</h1>
			</div>
			<NavigationMenu loggedIn={loggedIn} isAdmin={isAdmin}/>
		</header>
	);
};

export default Header;
